const rand_num = Math.floor(Math.random() * 5);
console.log(rand_num);
const res = await chai.request(app).get('/'+rand_num);
// expect(res).to.have.status(200);
newproduct = res.body;
// console.log(newproduct);
expect(res).to.have.status(200);
discuss = await products.create(newproduct);
lastproduct = await products.findById(discuss._id);

expect(lastproduct._id).to.be.a('object');
expect(lastproduct.name).to.be.an('string');
expect(lastproduct.Quantity).to.be.a('number');
expect(lastproduct.Price).to.be.a('number');
expect(lastproduct.instock).to.be.a('string');
expect(lastproduct.instock).to.be.oneOf(['Yes', 'No']);

